import React from 'react';
import PropTypes from 'prop-types';

const AllGradeList = ({title,schoolYear}) => {
    return (
        <div>
            <div>
                {title}
            </div>
            <table>
                <tbody>
                {
                    schoolYear.map(grade=>(
                        <tr className="search_row">
                            <td>{grade.grade}{grade.secondName}</td>
                            <td>{grade.teacher}</td>
                            <td></td>
                            <td>
                                <button  className="stu_add">
                                   redakciika :)
                                </button>
                            </td>
                        </tr>
                    ))
                }
                </tbody>
            </table>

        </div>
    );
};

AllGradeList.propTypes = {

};

export default AllGradeList;
